import React from 'react';

const Header = () => {
    return (
        <header style={{
            padding: '1.5rem',
            backgroundColor: 'transparent', // Light, minimalistic background
            textAlign: 'center',
            color: '#222', // Accessible dark text
            borderBottom: '1px solid #e0e0e0' // Subtle bottom border for structure
        }}>
            <h1 style={{
                fontSize: '1.8rem', // Slightly smaller for a sleek look
                fontWeight: '500', // Lighter font weight
                margin: '0',
                fontFamily: 'Helvetica, Arial, sans-serif'
            }}>
                Centered Div Therapy
            </h1>
        </header>
    );
};

export default Header;
